  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done :=1;

  START TRANSACTION;

  OPEN cursor1;
loop1:LOOP FETCH cursor1 INTO v_id, v_memberid, v_bonus,v_index, v_tax,v_uname,v_fname,v_phone,v_balance;
