CREATE PROCEDURE `sp_register_` (IN `@member_id` INT)  MODIFIES SQL DATA BEGIN

  set @package_id=NULL;
  set @last_level = 1;
  set @last_lvl=1;
  set @type=NULL;
  set @possponsor=NULL;

  select `sponsor_id`,`upline_id`,`position`,`omzet`
  into @sponsor_id,@upline_id,@last_position,@omzet
  from `customers` where `id`=@member_id;

  set @sponsor_member_id=@sponsor_id;
  set @last_sponsor=@sponsor_id;

  SELECT `id` INTO @package_id FROM `customer_package` WHERE `price`<=@omzet ORDER BY `price` DESC LIMIT 1;

  if @package_id IS NOT NULL then
    update `customers` set `package_id`=@package_id where `id`=@member_id;
  end if;

  if @last_position = 'left' then
    update `customers` set foot_left = @member_id where id = @upline_id;
  else
    update `customers` set foot_right = @member_id where id = @upline_id;
  end if;

  SET @last_upline=@upline_id;
  while @last_upline > 0 do
    set @last_level = @last_level + 1;
    select `upline_id`, `position`
    into @last_upline, @last_position
    from customers where id=@last_upline;
  end while;

  while @last_sponsor > 0 do
    select `sponsor_id`,`level`
      into @llast_sponsor,@stype
      from customers where id=@last_sponsor;
      SET @last_sponsor=@llast_sponsor;
      set @last_lvl = @last_lvl + 1;
  end while;

  select `position`
    into @possponsor
    from customer_networks where member_id=@member_id AND upline_id=@sponsor_id;

  IF @possponsor IS NOT NULL THEN
    IF @possponsor = 'left' THEN
        update customers set sponsor_left=sponsor_left + 1 where id = @sponsor_id;
        SET @sleft= @sleft + 1;
    ELSE
        update customers set sponsor_right=sponsor_right + 1 where id = @sponsor_id;
        SET @sright= @sright + 1;
    END IF;
  END IF;

  while @upline_id > 0 do

    select `sponsor_id`,`upline_id`,`total_left`, `total_right`,`sponsor_left`,`sponsor_right`
    into @sponsor_upline_id,@parent_upline,@parent_total_left,@parent_total_right,@pspl,@pspr
    from customers where id = @upline_id;

    select `position`, `upline_id`
    into @member_position, @member_id
    from customers where id = @member_id;

    if @member_position = 'right' then
      update customers
      set total_right = total_right + 1
      where id = @upline_id;
    else
      update customers
      set total_left = total_left + 1
      where id = @upline_id;
    end if;

    set @upline_id = @parent_upline;
  end while;
END$$

CREATE PROCEDURE `sp_registration` (IN `p_member_id` INT UNSIGNED)   main: BEGIN
    /* =========================
       Callback / status output
       ========================= */
    DECLARE v_success TINYINT DEFAULT 0;
    DECLARE v_code    INT DEFAULT 0;
    DECLARE v_message VARCHAR(512) DEFAULT 'OK';

    /* transaksi flag (biar ROLLBACK tidak error kalau tx belum mulai) */
    DECLARE v_tx_started TINYINT DEFAULT 0;

    /* =========================
       Error diagnostics (MySQL 8+)
       ========================= */
    DECLARE v_errno    INT DEFAULT 0;
    DECLARE v_sqlstate CHAR(5) DEFAULT '00000';
    DECLARE v_errmsg   TEXT;

    /* NOT FOUND flag (untuk SELECT ... INTO yang tidak ketemu) */
    DECLARE v_not_found TINYINT DEFAULT 0;

    /* =========================
       Business variables
       ========================= */
    DECLARE v_sponsor_id     INT UNSIGNED;
    DECLARE v_upline_id      INT UNSIGNED;
    DECLARE v_last_position  VARCHAR(10);
    DECLARE v_omzet          DECIMAL(18,2);

    DECLARE v_package_id     INT UNSIGNED;
    DECLARE v_flush_out      INT UNSIGNED;

    DECLARE v_last_upline    INT UNSIGNED;
    DECLARE v_level          INT DEFAULT 1;

    DECLARE v_last_sponsor   INT UNSIGNED;
    DECLARE v_prev_sponsor   INT UNSIGNED;
    DECLARE v_lvl            INT DEFAULT 1;

    DECLARE v_pos_sponsor    VARCHAR(10);

    DECLARE v_cur_member     INT UNSIGNED;
    DECLARE v_cur_upline     INT UNSIGNED;
    DECLARE v_member_pos     VARCHAR(10);

    /* =========================
       HANDLERS (harus SETELAH semua DECLARE variable)
       ========================= */
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_not_found = 1;

    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        GET DIAGNOSTICS CONDITION 1
            v_errno    = MYSQL_ERRNO,
            v_sqlstate = RETURNED_SQLSTATE,
            v_errmsg   = MESSAGE_TEXT;

        IF v_tx_started = 1 THEN
            ROLLBACK;
        END IF;

        SET v_success = 0;
        SET v_code    = IFNULL(v_errno, -1);
        SET v_message = CONCAT(
            'sp_register_test gagal (SQLSTATE ', IFNULL(v_sqlstate,'-----'), '): ',
            IFNULL(v_errmsg,'Unknown error')
        );

        SELECT v_success AS success, v_code AS code, v_message AS message;
    END;

    /* =========================
       Validate input
       ========================= */
    IF p_member_id IS NULL OR p_member_id = 0 THEN
        SET v_success = 0;
        SET v_code    = 400;
        SET v_message = 'member_id tidak valid';
        SELECT v_success AS success, v_code AS code, v_message AS message;
        LEAVE main;
    END IF;

    START TRANSACTION;
    SET v_tx_started = 1;

    /*CALL sp_update_personal_omzet_placement(p_member_id);*/

    /* =========================
       Ambil data member (lock row)
       ========================= */
    SET v_not_found = 0;
    SELECT sponsor_id, upline_id, position, omzet
      INTO v_sponsor_id, v_upline_id, v_last_position, v_omzet
    FROM customers
    WHERE id = p_member_id
    FOR UPDATE;

    IF v_not_found = 1 THEN
        ROLLBACK;
        SET v_tx_started = 0;

        SET v_success = 0;
        SET v_code    = 404;
        SET v_message = CONCAT('Member tidak ditemukan: id=', p_member_id);
        SELECT v_success AS success, v_code AS code, v_message AS message;
        LEAVE main;
    END IF;

    SET v_omzet = IFNULL(v_omzet, 0);

    /* =========================
       Tentukan package dari omzet (kalau ada)
       ========================= */
    SET v_not_found = 0;
    SELECT id, flush_out
      INTO v_package_id, v_flush_out
    FROM customer_package
    WHERE price <= v_omzet
    ORDER BY price DESC
    LIMIT 1;

    IF v_not_found = 1 THEN
        SET v_package_id = NULL;
    END IF;

    IF v_package_id IS NOT NULL THEN
        UPDATE customers
        SET package_id = v_package_id, max_daily_pairing=v_flush_out, network_generated=1
        WHERE id = p_member_id;
    END IF;

    /* =========================
       Validasi upline & set foot kiri/kanan (hindari overwrite)
       ========================= */
    IF v_upline_id IS NULL OR v_upline_id = 0 THEN
        ROLLBACK;
        SET v_tx_started = 0;

        SET v_success = 0;
        SET v_code    = 422;
        SET v_message = 'Upline tidak valid / belum di-set untuk member ini';
        SELECT v_success AS success, v_code AS code, v_message AS message;
        LEAVE main;
    END IF;

    /*IF v_last_position = 'left' THEN
        UPDATE customers
        SET foot_left = p_member_id
        WHERE id = v_upline_id
          AND (foot_left IS NULL OR foot_left = 0);

        IF ROW_COUNT() = 0 THEN
            ROLLBACK;
            SET v_tx_started = 0;

            SET v_success = 0;
            SET v_code    = 409;
            SET v_message = CONCAT('Slot upline.left sudah terisi (upline_id=', v_upline_id, ')');
            SELECT v_success AS success, v_code AS code, v_message AS message;
            LEAVE main;
        END IF;

    ELSEIF v_last_position = 'right' THEN
        UPDATE customers
        SET foot_right = p_member_id
        WHERE id = v_upline_id
          AND (foot_right IS NULL OR foot_right = 0);

        IF ROW_COUNT() = 0 THEN
            ROLLBACK;
            SET v_tx_started = 0;

            SET v_success = 0;
            SET v_code    = 409;
            SET v_message = CONCAT('Slot upline.right sudah terisi (upline_id=', v_upline_id, ')');
            SELECT v_success AS success, v_code AS code, v_message AS message;
            LEAVE main;
        END IF;
    ELSE
        ROLLBACK;
        SET v_tx_started = 0;

        SET v_success = 0;
        SET v_code    = 422;
        SET v_message = CONCAT('Position member tidak valid: ', IFNULL(v_last_position,'NULL'));
        SELECT v_success AS success, v_code AS code, v_message AS message;
        LEAVE main;
    END IF;*/

    /* =========================
       Build customer_networks (jalur upline)
       ========================= */
    SET v_last_upline = v_upline_id;

    WHILE v_last_upline IS NOT NULL AND v_last_upline > 0 DO
        VALUES (NULL, p_member_id, v_last_upline, v_last_position, 1, v_level, NULL, NOW(), NULL);

        SET v_level = v_level + 1;

        SET v_not_found = 0;
        SELECT upline_id, position
          INTO v_last_upline, v_last_position
        FROM customers
        WHERE id = v_last_upline;

        IF v_not_found = 1 THEN
            ROLLBACK;
            SET v_tx_started = 0;

            SET v_success = 0;
            SET v_code    = 500;
            SET v_message = 'Integrity error: data upline chain putus (customers tidak ditemukan)';
            SELECT v_success AS success, v_code AS code, v_message AS message;
            LEAVE main;
        END IF;
    END WHILE;

    /* =========================
       Build customer_network_matrixes (jalur sponsor)
       ========================= */
    SET v_last_sponsor = IFNULL(v_sponsor_id, 0);

    WHILE v_last_sponsor IS NOT NULL AND v_last_sponsor > 0 DO
        VALUES (NULL, p_member_id, v_last_sponsor, v_lvl, NULL, CURRENT_DATE(), NULL);

        SET v_lvl = v_lvl + 1;
        SET v_prev_sponsor = v_last_sponsor;

        SET v_not_found = 0;
        SELECT sponsor_id
          INTO v_last_sponsor
        FROM customers
        WHERE id = v_prev_sponsor;

        IF v_not_found = 1 THEN
            ROLLBACK;
            SET v_tx_started = 0;

            SET v_success = 0;
            SET v_code    = 500;
            SET v_message = CONCAT('Integrity error: sponsor chain putus (sponsor_id tidak ditemukan untuk id=', v_prev_sponsor, ')');
            SELECT v_success AS success, v_code AS code, v_message AS message;
            LEAVE main;
        END IF;

        SET v_last_sponsor = IFNULL(v_last_sponsor, 0);
    END WHILE;

    /* =========================
       Update sponsor_left / sponsor_right
       ========================= */
    IF v_sponsor_id IS NOT NULL AND v_sponsor_id > 0 THEN
        SET v_not_found = 0;
        SELECT position
          INTO v_pos_sponsor
        FROM customer_networks
        WHERE member_id = p_member_id
          AND upline_id = v_sponsor_id
        LIMIT 1;

        IF v_not_found = 0 AND v_pos_sponsor IS NOT NULL THEN
            IF v_pos_sponsor = 'left' THEN
                UPDATE customers SET sponsor_left  = sponsor_left  + 1 WHERE id = v_sponsor_id;
            ELSEIF v_pos_sponsor = 'right' THEN
                UPDATE customers SET sponsor_right = sponsor_right + 1 WHERE id = v_sponsor_id;
            END IF;
        END IF;
    END IF;

    /* =========================
       Update total_left / total_right untuk seluruh upline chain
       ========================= */
    SET v_cur_member = p_member_id;
    SET v_cur_upline = v_upline_id;

    WHILE v_cur_upline IS NOT NULL AND v_cur_upline > 0 DO
        SET v_not_found = 0;
        SELECT position
          INTO v_member_pos
        FROM customers
        WHERE id = v_cur_member;

        IF v_not_found = 1 THEN
            ROLLBACK;
            SET v_tx_started = 0;

            SET v_success = 0;
            SET v_code    = 500;
            SET v_message = 'Integrity error: member chain putus saat update total_left/total_right';
            SELECT v_success AS success, v_code AS code, v_message AS message;
            LEAVE main;
        END IF;

        IF v_member_pos = 'right' THEN
            UPDATE customers SET total_right = total_right + 1 WHERE id = v_cur_upline;
        ELSE
            UPDATE customers SET total_left  = total_left  + 1 WHERE id = v_cur_upline;
        END IF;

        SET v_cur_member = v_cur_upline;

        SET v_not_found = 0;
        SELECT upline_id
          INTO v_cur_upline
        FROM customers
        WHERE id = v_cur_member;

        IF v_not_found = 1 THEN
            ROLLBACK;
            SET v_tx_started = 0;

            SET v_success = 0;
            SET v_code    = 500;
            SET v_message = 'Integrity error: upline_id parent tidak ditemukan';
            SELECT v_success AS success, v_code AS code, v_message AS message;
            LEAVE main;
        END IF;

        SET v_cur_upline = IFNULL(v_cur_upline, 0);
    END WHILE;

    CALL sp_update_group_omzet_placement(p_member_id);
    CALL sp_bonus_sponsor_placement(p_member_id);
    CALL sp_bonus_pairing_placement(p_member_id, 350000,20000);

    COMMIT;
    SET v_tx_started = 0;

    SET v_success = 1;
    SET v_code    = 200;
    SET v_message = CONCAT(
        'Register berhasil. member_id=', p_member_id,
        ', package_id=', IFNULL(v_package_id, 0),
        ', sponsor_id=', IFNULL(v_sponsor_id, 0),
        ', upline_id=', IFNULL(v_upline_id, 0)
    );

    SELECT v_success AS success, v_code AS code, v_message AS message;
END main$$

CREATE PROCEDURE `sp_request_withdrawal` (IN `p_customer_id` BIGINT UNSIGNED, IN `p_amount` DECIMAL(18,2), IN `p_admin_fee` DECIMAL(18,2), OUT `o_success` TINYINT(1), OUT `o_message` VARCHAR(255), OUT `o_withdrawal_id` BIGINT UNSIGNED, OUT `o_transaction_ref` VARCHAR(100), OUT `o_balance_before` DECIMAL(18,2))   proc:BEGIN
    DECLARE v_customer_name   VARCHAR(255);
    DECLARE v_bank_name       VARCHAR(100);
    DECLARE v_bank_account    VARCHAR(100);
    DECLARE v_nik             VARCHAR(50);

    DECLARE v_customer_saldo  DECIMAL(18,2);
    DECLARE v_admin_fee       DECIMAL(18,2);
    DECLARE v_net_amount      DECIMAL(18,2);

    DECLARE v_existing_id     BIGINT UNSIGNED;

    DECLARE v_notes_json      JSON;

    DECLARE v_not_found       TINYINT(1) DEFAULT 0;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET v_not_found = 1;

    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        ROLLBACK;
        SET o_success         = 0;
        SET o_withdrawal_id   = NULL;
        SET o_transaction_ref = NULL;
        SET o_balance_before  = NULL;
        SET o_message         = COALESCE(o_message, 'Terjadi kesalahan saat membuat withdrawal');
    END;

    -- default output
    SET o_success         = 0;
    SET o_message         = NULL;
    SET o_withdrawal_id   = NULL;
    SET o_transaction_ref = NULL;
    SET o_balance_before  = NULL;

    /* =========================
       VALIDASI INPUT (ketat)
       ========================= */
    IF p_customer_id IS NULL OR p_customer_id = 0 THEN
        SET o_message = 'Customer ID tidak valid';
        LEAVE proc;
    END IF;

    IF p_amount IS NULL THEN
        SET o_message = 'Nominal penarikan wajib diisi';
        LEAVE proc;
    END IF;

    IF p_amount <= 0 THEN
        SET o_message = 'Nominal penarikan harus lebih besar dari 0';
        LEAVE proc;
    END IF;

    -- minimum 50k (match controller)
    IF p_amount < 50000 THEN
        SET o_message = 'Nominal penarikan minimal 50.000';
        LEAVE proc;
    END IF;

    -- Admin fee default 6500
    SET v_admin_fee = IFNULL(p_admin_fee, 6500);

    IF v_admin_fee < 0 THEN
        SET o_message = 'Biaya admin tidak boleh negatif';
        LEAVE proc;
    END IF;

    -- fee tidak boleh >= amount
    IF v_admin_fee >= p_amount THEN
        SET o_message = 'Nominal penarikan tidak mencukupi setelah biaya admin (biaya admin >= nominal)';
        LEAVE proc;
    END IF;

    SET v_net_amount = p_amount - v_admin_fee;

    /* =========================
       TRANSACTION
       ========================= */
    START TRANSACTION;

    -- 1) Lock customer row + ambil saldo dan bank info (serialize request per customer)
    SET v_not_found = 0;
    SELECT
        c.ewallet_saldo,
        c.name,
        c.bank_name,
        c.bank_account,
        c.nik
    INTO
        v_customer_saldo,
        v_customer_name,
        v_bank_name,
        v_bank_account,
        v_nik
    FROM customers c
    WHERE c.id = p_customer_id
    FOR UPDATE;

    IF v_not_found = 1 THEN
        ROLLBACK;
        SET o_message = CONCAT('Pelanggan tidak ditemukan (ID: ', p_customer_id, ')');
        LEAVE proc;
    END IF;

    -- safeguard: saldo di DB tidak boleh negatif (data corrupt)
    IF v_customer_saldo IS NULL THEN
        ROLLBACK;
        SET o_message = 'Saldo pelanggan tidak tersedia (NULL). Hubungi admin.';
        LEAVE proc;
    END IF;

    IF v_customer_saldo < 0 THEN
        ROLLBACK;
        SET o_message = CONCAT('Saldo pelanggan tidak valid (negatif): ', FORMAT(v_customer_saldo, 2), '. Hubungi admin.');
        LEAVE proc;
    END IF;

    -- snapshot untuk approve SP
    SET o_balance_before = v_customer_saldo;

    -- 2) Validasi profil lengkap + rinci errornya
    IF v_nik IS NULL OR v_nik = '' THEN
        ROLLBACK;
        SET o_message = 'NIK belum diisi. Lengkapi NIK di profil sebelum melakukan penarikan.';
        LEAVE proc;
    END IF;

    IF v_bank_name IS NULL OR v_bank_name = '' THEN
        ROLLBACK;
        SET o_message = 'Nama bank belum diisi. Lengkapi informasi bank di profil sebelum melakukan penarikan.';
        LEAVE proc;
    END IF;

    IF v_bank_account IS NULL OR v_bank_account = '' THEN
        ROLLBACK;
        SET o_message = 'Nomor rekening bank belum diisi. Lengkapi informasi bank di profil sebelum melakukan penarikan.';
        LEAVE proc;
    END IF;

    IF v_customer_name IS NULL OR v_customer_name = '' THEN
        ROLLBACK;
        SET o_message = 'Nama pemilik rekening belum tersedia. Lengkapi nama Anda di profil.';
        LEAVE proc;
    END IF;

    -- 3) Cek pending withdrawal (anti double request)
    SET v_not_found = 0;
    SELECT id
    INTO v_existing_id
    FROM customer_wallet_transactions
    WHERE customer_id = p_customer_id
      AND type = 'withdrawal'
      AND status = 'pending'
    LIMIT 1
    FOR UPDATE;

    IF v_not_found = 0 THEN
        ROLLBACK;
        SET o_message = CONCAT(
            'Masih ada withdrawal pending (ID: ', v_existing_id, '). ',
            'Silakan tunggu hingga permintaan sebelumnya diproses.'
        );
        LEAVE proc;
    END IF;

    -- 4) Validasi saldo cukup (informatif)
    IF v_customer_saldo < p_amount THEN
        ROLLBACK;
        SET o_message = CONCAT(
            'Saldo tidak mencukupi. Saldo Anda: ',
            FORMAT(v_customer_saldo, 0),
            ', nominal penarikan: ',
            FORMAT(p_amount, 0),
            ', kurang: ',
            FORMAT((p_amount - v_customer_saldo), 0)
        );
        LEAVE proc;
    END IF;

    -- 5) Generate transaction_ref
    SET o_transaction_ref = CONCAT(
        'WD-',
        DATE_FORMAT(NOW(), '%Y%m%d%H%i%s'),
        '-',
        UPPER(SUBSTRING(REPLACE(UUID(), '-', ''), 1, 6))
    );

    -- 6) Notes JSON: wajib ada bank_name/bank_account/bank_holder agar approve SP lolos
    SET v_notes_json = JSON_OBJECT(
        'bank_name', v_bank_name,
        'bank_account', v_bank_account,
        'bank_holder', v_customer_name,
        'gross_amount', p_amount,
        'admin_fee', v_admin_fee,
        'net_amount', v_net_amount,
        'requested_at', DATE_FORMAT(NOW(), '%Y-%m-%d %H:%i:%s')
    );

    -- 7) Insert transaksi withdrawal (PENDING), saldo BELUM dipotong di sini
        customer_id,
        type,
        amount,
        balance_before,
        balance_after,
        status,
        transaction_ref,
        notes,
        created_at,
        updated_at,
        is_system
    )
    VALUES
    (
        p_customer_id,
        'withdrawal',
        p_amount,
        v_customer_saldo,
        v_customer_saldo, -- belum berubah; saldo akan berubah saat approve
        'pending',
        o_transaction_ref,
        v_notes_json,
        NOW(),
        NOW(),
        1
    );

    SET o_withdrawal_id = LAST_INSERT_ID();

    COMMIT;

    SET o_success = 1;
    SET o_message = CONCAT(
        'Permintaan penarikan berhasil dibuat (Ref: ', o_transaction_ref, '). ',
        'Akan diproses dalam 1-3 hari kerja.'
    );
END$$

CREATE PROCEDURE `sp_update_group_omzet` (IN `p_order_id` INT)   BEGIN
    DECLARE v_customer INT;
    DECLARE v_subtotal DECIMAL(15,2) DEFAULT 0;
    DECLARE v_pairing DECIMAL(15,2) DEFAULT 0;
    DECLARE v_pr DECIMAL(15,2) DEFAULT 0;
    DECLARE v_type VARCHAR(20);
    DECLARE v_upline INT;
    DECLARE v_sponsor INT;
    DECLARE v_parent INT;
    DECLARE v_parent_sponsor INT;
    DECLARE v_pos VARCHAR(10);
    DECLARE v_guard INT DEFAULT 0;

    SET v_subtotal=0;

    SELECT o.customer_id, o.subtotal_amount, o.pairing_amount, o.bv_amount, c.upline_id, c.sponsor_id, c.position,o.type
    INTO v_customer, v_subtotal, v_pairing, v_pr, v_upline, v_sponsor, v_pos, v_type
    FROM orders o
    JOIN customers c ON c.id = o.customer_id
    WHERE o.id = p_order_id;

    WHILE v_upline IS NOT NULL DO
        SET v_guard = v_guard + 1;
        IF v_type = 'planA' THEN
            IF v_pos = 'left' THEN
                UPDATE customers
                SET omzet_group_left = omzet_group_left + v_subtotal, omzet_pairing_left = omzet_pairing_left + v_pairing, omzet_group_left_plana = omzet_group_left_plana + v_pairing
                WHERE id = v_upline;
                CALL sp_generate_reward_plana(v_upline,v_pr,0);
            ELSE
                UPDATE customers
                SET omzet_group_right = omzet_group_right + v_subtotal, omzet_pairing_right = omzet_pairing_right + v_pairing, omzet_group_right_plana = omzet_group_right_plana + v_pairing
                WHERE id = v_upline;
                CALL sp_generate_reward_plana(v_upline,0,v_pr);
            END IF;
        ELSEIF v_type = 'planB' THEN
            IF v_pos = 'left' THEN
                UPDATE customers
                SET omzet_group_left = omzet_group_left + v_subtotal, omzet_group_left_planb = omzet_group_left_planb + v_subtotal
                WHERE id = v_upline;
            ELSE
                UPDATE customers
                SET omzet_group_right = omzet_group_right + v_subtotal, omzet_group_right_planb = omzet_group_right_planb + v_subtotal
                WHERE id = v_upline;
            END IF;
        END IF;

        SELECT position, upline_id
        INTO v_pos, v_parent
        FROM customers
        WHERE id = v_upline;

        /*SET v_customer = v_upline;*/
        SET v_upline = v_parent;
    END WHILE;

    IF v_type = 'planA' THEN
    	 WHILE v_sponsor IS NOT NULL DO
            UPDATE customers SET omzet_group = omzet_group + v_subtotal WHERE id = v_sponsor;
            SELECT sponsor_id
            INTO v_parent_sponsor
            FROM customers
            WHERE id = v_sponsor;

            SET v_sponsor = v_parent_sponsor;
        END WHILE;
     END IF;
END$$

CREATE PROCEDURE `sp_update_group_omzet_manual` (IN `p_order_id` INT)   BEGIN
    DECLARE v_customer INT;
